import React, { Component } from "react";
import Form from "../form/Form";
import { withRouter } from "react-router-dom";
import Button from "../button/Button";

export class Invoice extends Component {
  render() {
    return (
      <div className="pagez">
        <h1>Нэхэмжлэл</h1>
        <div className="form_holder">
          <Form placeholder="хэмжээ" id="1" />
          <Form placeholder="callback" id="2" />
          <Form placeholder="checksum" id="3" />
          <Form placeholder="genToken" id="4" />
          <Form placeholder="returnType" id="5" />
          <Form placeholder="transactionId" id="6" />
        </div>
        <div id="buuz"></div>
        <Button onclk={this.clk} whichcomp="invoice"></Button>
      </div>
    );
  }
  clk = () => {
    this.props.history.push("/api/showdata");
  };
}

export default withRouter(Invoice);
